import React from 'react';
import TweetItem from "./TweetItem"
import {Tweet} from "../Types"

type Props = {
  tweets : Tweet[]
}

const tweetList: React.FC<Props> = ({tweets}) => {
  return (
    <div>
      <ul>
      { tweets.map(tweet => (
        <TweetItem
            key = {tweet.id}
            tweet = {tweet}
            />
      )) }
      </ul>
    </div>
  )
}

export default tweetList;
